import React from "react";
import "./Home.css";
import { Link, useLocation } from "react-router-dom";

function Home() {
  const { pathname } = useLocation();

  // var OiaPic = document.getElementById("OiaImage");
  // OiaPic.src = "src/Pictures/Renke_at_Oia.jpg";

  return (
    <section className="home-page">
      <header className="header">
        <div className="overlap-group">
          <Link to="/Home" className="text-wrapper-2">
            Renke Cui
          </Link>
          <div className="nav-bar">
            <div className="works-button">
              <Link
                to="/Projects"
                className={`nav-link ${
                  pathname.includes("Projects") ? "active" : ""
                }`}
              >
                Projects
              </Link>
            </div>
            <div className="about-me-button">
              <Link
                to="/About"
                className={`button text-wrapper-3${
                  pathname.includes("About") ? "active" : ""
                }`}
              >
                About Me
              </Link>
            </div>
          </div>
        </div>
      </header>
      <content></content>
    </section>
  );
}

export default Home;
